import React from 'react';
import Pokemon from './Pokemon';

const PokemonList = props => {
    return(
        <ul ClassName="pokemonlist">
            {props.items.map(item =>{
                return (
                    <li className="Pokelislt_li" key={item}>
                        <Pokemon 
                        imageUrl = {item.url} 
                        pokemonTitle ={item.name}
                        types ={item.types}
                        />
                    </li>
                )
            })}
        </ul>
    )
}
export default PokemonList;
